const ToDo = ({id, name}) => {

  return (
    <>
    <div key={id} className="todo">
        <p>{name}</p>
        <p onClick={() => removeBox(id)}>X</p>
    </div>
    {/* <p onClick={() => removeBox(id)}>X</p> */}
    </>
  )
}

export default ToDo;
